import React, { Component } from 'react';
import FlimDetails from './FlimDetails';



class FlimListing extends Component {

	render() {
		const allFlims = this.props.tmdb.flims.map((flim) => {
			return (
				<FlimDetails title={flim.title}
					id={flim.id}
					year={flim.year} />)

		});
		return (
			<FlimListing flimslist={allFlims} />


		)


	}
}


export default FlimListing;
